import React from "react";
import Cards from "../components/Cards";
import Grid from "@material-ui/core/Grid";

function Dashboard() {
  return (
    <div>
      <Grid container spacing={3}>
        <Grid item>
          <Cards />
        </Grid>
        <Grid item>
          <Cards />
        </Grid>
      </Grid>
    </div>
  );
}

export default Dashboard;
